import axios from "axios";
import { useEffect, useState } from "react";

function uploadImage(){

    const [doc, setDoc] = useState();


    const upload = (e) => {
        e.preventDefault();

        axios.post("http://localhost:3080/upload", )
            .then()

    }

    const getImage = () => {
        axios.get("http://localhost:3080/file?type=img&id=61a45dee1d898f49a3b1f2da")
            .then()
    }

    const onFileChange = event => {
        console.log(event.target.files[0])
        const ImageUrl =  URL.createObjectURL(event.target.files[0]);
        setDoc(ImageUrl)
    };

    return(
        <div>
            <div className="upload">
                <form encType="multipart/form-data" onSubmit={upload}>
                    <div className="input-group mb-3">
                        <input className="form-control-file" type="file" id="file" name="files[]" multiple="multiple" onChange={onFileChange}></input>
                    </div>
                    <button type="submit" className="btn btn-primary">submit</button>
                </form>
            </div>
            <hr/>
            <div className="show-images">
                <div>
                    <img src="http://localhost:3080/file?type=img&id=61a45dee1d898f49a3b1f2da" width="250" height="250" alt="pic"/>
                </div>
                <button type="button" className="btn btn-primary mt-3" onClick={getImage}>Show image</button>
            </div>
        </div>
    )
}

export default uploadImage;
